import React from "react";
import P5Canvas from "./P5Canvas";
import sketches from "../scripts/sketches";

const P5Container = (props) => (
  <P5Canvas
    sketch={this.props.sketch}
    name={props.match.params.name}
    {...props}
  />
);

export default P5Container;
